import React from 'react';
import bridge from '@vkontakte/vk-bridge';
import '@vkontakte/vkui/dist/vkui.css';
import { View, Panel, PanelHeader, Button, Cell, Avatar, Div } from '@vkontakte/vkui';
import '@vkontakte/vkui/dist/vkui.css';

import Icon16Add from '@vkontakte/icons/dist/16/add';


class Feed extends React.Component {

render() {

    return (

<View id="feed"  activePanel="feed">
<Panel id="feed">
  <PanelHeader>Главная</PanelHeader>
  <Cell
size="l"
description="Группа сервиса"
before={<Avatar src="https://sun9-24.userapi.com/c856520/v856520080/13a615/MOxzZ-wuRFM.jpg"/>}
bottomContent={<Button before={<Icon16Add/>} onClick={() => bridge.send("VKWebAppJoinGroup", {"group_id": 95380950})}disabled>Вступить</Button>} >Nebulous</Cell>
<Div><img src="https://vk.com/sticker/1-20227-128" /></Div>
<Placeholder
          icon="https://vk.com/sticker/1-20227-128"
          header="Предложить свой скин"
  action={<Button mode="commerce" size="l">Предложить скин</Button>}
          >
          <h4>Привет! В данном разделе ты можешь предложить свой собственный скин для каталога приложения!
          Владелец каждого скина, который будет принят в каталог приложения получит от 2,500 до 5,000
          плазмы от администраторов сообщества Nebulous.</h4>
        </Placeholder>
</Panel>
</View>
    )
}
}
export default Feed;
